// src/routes/houseManage.ts
init_notificationService();
var validateHouseData = (data) => {
  const errors3 = [];
  if (!data.address?.trim()) {
    errors3.push("Address is required");
  }
  return errors3;
};
var validateUpdateData = (data) => {
  const errors3 = [];
  if (data.address !== undefined && !data.address.trim()) {
    errors3.push("Address cannot be empty");
  }
  if (data.status !== undefined && !["available", "occupied", "disable"].includes(data.status)) {
    errors3.push("Invalid status. Must be: available, occupied, or disable");
  }
  return errors3;
};
var validateStatus = (status) => {
  return ["available", "occupied", "disable"].includes(status);
};
var houseManageRoutes = new Elysia({ prefix: "/api" }).onBeforeHandle(requireRole("admin")).get("/houses", async ({ currentUser }) => {
  try {
    const { village_key } = currentUser;
    const result = await drizzle_default.select().from(houses).where(eq(houses.village_key, village_key));
    return {
      success: true,
      data: result,
      total: result.length
    };
  } catch (error4) {
    console.error("Error fetching houses:", error4);
    return {
      success: false,
      error: "Failed to fetch houses"
    };
  }
}).post("/house-manage", async ({ body, currentUser }) => {
  try {
    const houseData = body;
    const validationErrors = validateHouseData(houseData);
    if (validationErrors.length > 0) {
      return {
        success: false,
        error: validationErrors.join(", ")
      };
    }
    const adminVillageKey = currentUser.village_key;
    const existingVillage = await drizzle_default.select().from(villages).where(eq(villages.village_key, adminVillageKey));
    if (existingVillage.length === 0) {
      return {
        success: false,
        error: "Admin's village not found. Please contact system administrator."
      };
    }
    const [newHouse] = await drizzle_default.insert(houses).values({
      address: houseData.address.trim(),
      village_key: adminVillageKey
    }).returning();
    try {
      await houseActivityLogger.logHouseCreated(currentUser.admin_id, houseData.address.trim(), adminVillageKey);
    } catch (logError) {
      console.error("Error logging house creation:", logError);
    }
    return {
      success: true,
      message: "House created successfully!",
      data: newHouse
    };
  } catch (error4) {
    console.error("Error creating house:", error4);
    return {
      success: false,
      error: "Failed to create house. Please try again."
    };
  }
}).put("/house-manage/:house_id", async ({ params, body, currentUser }) => {
  try {
    const { house_id } = params;
    const updateData = body;
    if (!house_id?.trim()) {
      return {
        success: false,
        error: "House ID is required"
      };
    }
    const existingHouse = await drizzle_default.select().from(houses).where(eq(houses.house_id, house_id));
    if (existingHouse.length === 0) {
      return {
        success: false,
        error: "House not found!"
      };
    }
    if (existingHouse[0].village_key !== currentUser.village_key) {
      return {
        success: false,
        error: "You can only update houses in your own village!"
      };
    }
    const validationErrors = validateUpdateData(updateData);
    if (validationErrors.length > 0) {
      return {
        success: false,
        error: validationErrors.join(", ")
      };
    }
    const oldStatus = existingHouse[0].status;
    const dataToUpdate = {};
    if (updateData.address !== undefined)
      dataToUpdate.address = updateData.address.trim();
    if (updateData.status !== undefined)
      dataToUpdate.status = updateData.status;
    const [updatedHouse] = await drizzle_default.update(houses).set(dataToUpdate).where(eq(houses.house_id, house_id)).returning();
    try {
      const logResult = await houseActivityLogger.logHouseUpdated(currentUser.admin_id, house_id, existingHouse[0].address, dataToUpdate, {
        address: existingHouse[0].address,
        status: existingHouse[0].status || undefined
      });
      if (logResult) {
        console.log("House update logged successfully");
      } else {
        console.log("No actual changes detected, skipping log");
      }
    } catch (logError) {
      console.error("Error logging house update:", logError);
    }
    if (updateData.status !== undefined && oldStatus !== updateData.status) {
      try {
        await notificationService.notifyHouseStatusChange({
          house_id,
          address: updatedHouse.address,
          old_status: oldStatus,
          new_status: updateData.status,
          village_key: currentUser.village_key
        });
        console.log(`\uD83D\uDCE2 House status change notification sent: ${updatedHouse.address}`);
      } catch (notificationError) {
        console.error("\u274C Error sending house status change notification:", notificationError);
      }
    }
    return {
      success: true,
      message: "House updated successfully!",
      data: updatedHouse
    };
  } catch (error4) {
    console.error("Error updating house:", error4);
    return {
      success: false,
      error: "Failed to update house. Please try again."
    };
  }
}).patch("/house-manage/:house_id/status", async ({ params, body, currentUser }) => {
  try {
    const { house_id } = params;
    const { status } = body;
    if (!house_id?.trim()) {
      return {
        success: false,
        error: "House ID is required"
      };
    }
    if (!status || !validateStatus(status)) {
      return {
        success: false,
        error: "Invalid status. Must be: available, occupied, or disable"
      };
    }
    const existingHouse = await drizzle_default.select().from(houses).where(eq(houses.house_id, house_id));
    if (existingHouse.length === 0) {
      return {
        success: false,
        error: "House not found!"
      };
    }
    if (existingHouse[0].village_key !== currentUser.village_key) {
      return {
        success: false,
        error: "You can only update houses in your own village!"
      };
    }
    const oldStatus = existingHouse[0].status;
    const [updatedHouse] = await drizzle_default.update(houses).set({ status }).where(eq(houses.house_id, house_id)).returning();
    try {
      await houseActivityLogger.logHouseStatusUpdated(currentUser.admin_id, existingHouse[0].address, existingHouse[0].status || "unknown", status);
    } catch (logError) {
      console.error("Error logging house status update:", logError);
    }
    if (oldStatus !== status) {
      try {
        await notificationService.notifyHouseStatusChange({
          house_id,
          address: updatedHouse.address,
          old_status: oldStatus,
          new_status: status,
          village_key: currentUser.village_key
        });
        console.log(`\uD83D\uDCE2 House status change notification sent: ${updatedHouse.address}`);
      } catch (notificationError) {
        console.error("\u274C Error sending house status change notification:", notificationError);
      }
    }
    return {
      success: true,
      message: "House status updated successfully!",
      data: updatedHouse
    };
  } catch (error4) {
    console.error("Error updating house status:", error4);
    return {
      success: false,
      error: "Failed to update house status. Please try again."
    };
  }
}).delete("/house-manage/:house_id", async ({ params, currentUser }) => {
  try {
    const { house_id } = params;
    if (!house_id?.trim()) {
      return {
        success: false,
        error: "House ID is required"
      };
    }
    const existingHouse = await drizzle_default.select().from(houses).where(eq(houses.house_id, house_id));
    if (existingHouse.length === 0) {
      return {
        success: false,
        error: "House not found!"
      };
    }
    if (existingHouse[0].village_key !== currentUser.village_key) {
      return {
        success: false,
        error: "You can only delete houses in your own village!"
      };
    }
    const houseInfo = existingHouse[0];
    await drizzle_default.delete(houses).where(eq(houses.house_id, house_id));
    try {
      await houseActivityLogger.logHouseDeleted(currentUser.admin_id, houseInfo.address, houseInfo.village_key || "unknown");
    } catch (logError) {
      console.error("Error logging house deletion:", logError);
    }
    return {
      success: true,
      message: "House deleted successfully!"
    };
  } catch (error4) {
    console.error("Error deleting house:", error4);
    return {
      success: false,
      error: "Failed to delete house. Please try again."
    };
  }
});

