async function getWeeklyVisitorRecords() {
  const now = new Date;
  const currentDay = now.getDay();
  const startOfWeek = new Date(now);
  startOfWeek.setDate(now.getDate() - currentDay);
  startOfWeek.setHours(0, 0, 0, 0);
  const endOfWeek = new Date(startOfWeek);
  endOfWeek.setDate(startOfWeek.getDate() + 6);
  endOfWeek.setHours(23, 59, 59, 999);
  const weeklyRecords = await drizzle_default.select({
    visitor_record_id: visitor_records.visitor_record_id,
    entry_time: visitor_records.entry_time,
    record_status: visitor_records.record_status,
    createdAt: visitor_records.createdAt
  }).from(visitor_records).where(and(gte(visitor_records.entry_time, startOfWeek), lte(visitor_records.entry_time, endOfWeek)));
  const weekDays = [
    "Sunday",
    "Monday",
    "Tuesday",
    "Wednesday",
    "Thursday",
    "Friday",
    "Saturday"
  ];
  const weeklyData = weekDays.map((day2) => ({
    day: day2,
    approved: 0,
    pending: 0,
    rejected: 0,
    total: 0
  }));
  weeklyRecords.forEach((record3) => {
    if (!record3.entry_time)
      return;
    const recordDate = new Date(record3.entry_time);
    const dayOfWeek = recordDate.getDay();
    if (dayOfWeek >= 0 && dayOfWeek < 7) {
      const status = record3.record_status || "pending";
      weeklyData[dayOfWeek][status]++;
      weeklyData[dayOfWeek].total++;
    }
  });
  const result = {
    weekStart: startOfWeek.toISOString(),
    weekEnd: endOfWeek.toISOString(),
    currentDate: now.toISOString(),
    weeklyData,
    summary: {
      totalApproved: weeklyData.reduce((sum, day2) => sum + day2.approved, 0),
      totalPending: weeklyData.reduce((sum, day2) => sum + day2.pending, 0),
      totalRejected: weeklyData.reduce((sum, day2) => sum + day2.rejected, 0),
      totalRecords: weeklyData.reduce((sum, day2) => sum + day2.total, 0)
    }
  };
  return result;
}
async function getMonthlyVisitorRecords() {
  const currentYear = new Date().getFullYear();
  const startOfYear = new Date(currentYear, 0, 1);
  const endOfYear = new Date(currentYear, 11, 31, 23, 59, 59, 999);
  const yearlyRecords = await drizzle_default.select({
    visitor_record_id: visitor_records.visitor_record_id,
    entry_time: visitor_records.entry_time,
    record_status: visitor_records.record_status,
    createdAt: visitor_records.createdAt
  }).from(visitor_records).where(and(gte(visitor_records.entry_time, startOfYear), lte(visitor_records.entry_time, endOfYear)));
  const months = [
    "January",
    "February",
    "March",
    "April",
    "May",
    "June",
    "July",
    "August",
    "September",
    "October",
    "November",
    "December"
  ];
  const monthlyData = months.map((month, index2) => ({
    month,
    monthNumber: index2 + 1,
    approved: 0,
    pending: 0,
    rejected: 0,
    total: 0
  }));
  yearlyRecords.forEach((record3) => {
    if (record3.entry_time) {
      const recordDate = new Date(record3.entry_time);
      const monthIndex = recordDate.getMonth();
      if (monthIndex >= 0 && monthIndex < 12) {
        const status = record3.record_status || "pending";
        monthlyData[monthIndex][status]++;
        monthlyData[monthIndex].total++;
      }
    }
  });
  const result = {
    year: currentYear,
    yearStart: startOfYear.toISOString(),
    yearEnd: endOfYear.toISOString(),
    currentDate: new Date().toISOString(),
    monthlyData,
    summary: {
      totalApproved: monthlyData.reduce((sum, month) => sum + month.approved, 0),
      totalPending: monthlyData.reduce((sum, month) => sum + month.pending, 0),
      totalRejected: monthlyData.reduce((sum, month) => sum + month.rejected, 0),
      totalRecords: monthlyData.reduce((sum, month) => sum + month.total, 0)
    }
  };
  return result;
}
async function getYearlyVisitorRecords() {
  const allRecords = await drizzle_default.select({
    visitor_record_id: visitor_records.visitor_record_id,
    entry_time: visitor_records.entry_time,
    record_status: visitor_records.record_status,
    createdAt: visitor_records.createdAt
  }).from(visitor_records);
  const recordsByYear = {};
  allRecords.forEach((record3) => {
    if (record3.entry_time) {
      const recordDate = new Date(record3.entry_time);
      const year2 = recordDate.getFullYear();
      if (!recordsByYear[year2]) {
        recordsByYear[year2] = [];
      }
      recordsByYear[year2].push(record3);
    }
  });
  const yearlyData = Object.keys(recordsByYear).map((yearStr) => {
    const year2 = parseInt(yearStr);
    const yearRecords = recordsByYear[year2];
    const approved = yearRecords.filter((r2) => r2.record_status === "approved").length;
    const pending = yearRecords.filter((r2) => r2.record_status === "pending").length;
    const rejected = yearRecords.filter((r2) => r2.record_status === "rejected").length;
    const total = yearRecords.length;
    return {
      year: year2,
      approved,
      pending,
      rejected,
      total
    };
  }).sort((a2, b) => b.year - a2.year);
  const result = {
    currentDate: new Date().toISOString(),
    totalYears: yearlyData.length,
    yearlyData,
    summary: {
      totalApproved: yearlyData.reduce((sum, year2) => sum + year2.approved, 0),
      totalPending: yearlyData.reduce((sum, year2) => sum + year2.pending, 0),
      totalRejected: yearlyData.reduce((sum, year2) => sum + year2.rejected, 0),
      totalRecords: yearlyData.reduce((sum, year2) => sum + year2.total, 0)
    }
  };
  return result;
}

